constructor (props:iprops){
  super(props);

  this.state = {
    dplay: 'none',
    opac: 0
  };
}


 tnailOne(){   
   this.setState ({dplay:"flex",opac:1});
    }


render(){

   return(

    <div className = 'disp'>

        <img className = 'hdr' src = {require('./images/hdr.jpg')} alt = "Nandana in Maize Field"/>

        <p className = 'txt_one'>My Photo Albums</p>

        <div className = 'lne_a'></div>

        <div className = 'cont_a'>

        <figure>
            <img className = 'img_hvr'onClick = {this.tnailOne} src = {require('./images/Album-1/01.jpg')} alt = 'Baby Nandana' />
            <figcaption className = "cption">Those early days...</figcaption>
        </figure>

        </div>

        <div className = 'albm' style= {this.state} >

        <h1>{this.state}</h1>

          <img className = 'photo' style ={{display:this.state.dplay}} src={require('./images/Album-1/01.jpg')} 
            alt = 'baby nandana' />

        </div>





    </div>
  )
}

}
